import Link from 'next/link'
export default () => (
  <div className='hello'>
    <p>Hello World</p>
    <Link href= '/about'></Link>
    <style jsx>{`
      .hello {
        font: 15px Helvetica, Arial, sans-serif;
        background: #eee;
        padding: 100px;
        text-align: center;
        transition: 100ms ease-in background;
      }
      .hello:hover {
        background: #ccc;
      }
    `}</style>
  </div>
)
